// LanguageToTag converts a BCP 47 language tag to OpenType language system tags.
// Returns nil if no mapping exists.
// HarfBuzz equivalent: hb_ot_tags_from_language() in hb-ot-tag.cc
func LanguageToTag(lang string) []Tag {
	// Normalize: lowercase, use primary language subtag
	lang = strings.ToLower(lang)

	// Try full tag first
	if tags, ok := BCP47ToOpenType[lang]; ok {
		return tags
	}

	// Try primary language subtag (before first hyphen)
	if idx := strings.Index(lang, "-"); idx > 0 {
		primary := lang[:idx]
		if tags, ok := BCP47ToOpenType[primary]; ok {
			return tags
		}
	}

	return nil
}

// TagToLanguage converts an OpenType language system tag to a BCP 47 language tag.
// Returns empty string if no mapping exists.
// HarfBuzz equivalent: hb_ot_tag_to_language() in hb-ot-tag.cc
func TagToLanguage(tag Tag) string {
	if lang, ok := OpenTypeToBCP47[tag]; ok {
		return lang
	}
	return ""
}
